import React from "react";
import styles from "./Navbar.module.css";

function Navbar() {
  return (
    <div className={styles.navbar}>
      <div className={styles.left}>Go to main page</div>
      <div className={styles.center}>Центр</div>
      <div className={styles.right}>Login/Register</div>
    </div>
  );
}

export default Navbar;
